import React, { useState } from "react";
import "./style.css";
const students = [
  { name: "Adi", age: 22 },
  { name: "sara", age: 19 },
];
function App() {
  const [show, setShow] = useState(false);

  return (
    <nav className="nav__bar">
      <ul className="menu">
        <li className="menu__icon" onClick={() => setShow(true)}>
          <box-icon name="menu" color="floralwhite" size="md" />
          
        </li>
      </ul>
    </nav>
  );
}

export default App;
